// Header.js
import React from 'react';

const Header = () => {
  return (
    <header className="bg-white shadow py-4 px-6 flex justify-between items-center">
      <div>
        <h1 className="text-xl font-semibold text-gray-800">Welcome To Dashboard</h1>
        <p className="text-gray-600">Early Fire Prediction</p>
      </div>
      <div className="flex items-center">
        {/* Assuming you are using icons for notifications and profile */}
        <button className="text-gray-600 hover:text-gray-800 mr-4">
          Notifications
        </button>
        <button className="text-gray-600 hover:text-gray-800">
          Profile
        </button>
      </div>
    </header>
  );
};

export default Header;
